import { Table } from "react-bootstrap";
import "./Owner.css";
import Ownernav from "./Ownernav";
import { API_GET, API_POST } from "../../api";
import { useEffect, useState } from "react";
import Button from "react-bootstrap";




export default function OwnerorderHistory() {
    let pages = 4;

    const [listhistory, setListhistory] = useState([]);

    useEffect(() => {
        // setUserId(localStorage.getItem('user_id'));
        async function fetchData() {
            let json = await API_GET("order/getorder/" + localStorage.getItem('user_id'));
            setListhistory(json.data);
            console.log(json);
        }
        fetchData();
        console.log(listhistory);
    }, []);

    return (
        <>
            <div className='container-fluid  '>
                <div className='row'>
                    <div className="col-lg-2 p-0  sidebar" >
                        <Ownernav pages={pages} />
                    </div>

                    <div className="col-lg-10 p-0 title content"><br></br>
                        <h1><center>ประวัติคำสั่งซื้อ</center></h1><br></br>

                        <div className='row mt-1 '>
                            <div className='col text-center f1 table-overflow'>
                                <Table striped>
                                    <thead className="frame3  text-white">
                                        <tr>
                                            <th>หมายเลขคำสั่งซื้อ</th>
                                            <th>แฟรนไชส์</th>
                                            <th>วันที่สั่งซื้อ</th>
                                            <th>ยอดเงินรวม</th>
                                            <th>สถานะ</th>
                                            <th>อนุมัติคำสั่งซื้อ</th>

                                        </tr>
                                    </thead>

                                    <tbody>
                                        {
                                            listhistory.map(item => (
                                                <tr>
                                                    <td>{item.order_id}</td>
                                                    <td>{item.order_date}</td>
                                                    <td>{item.total}</td>
                                                    <td>{item.status}</td>{/* ไม่แสดงสถานะ */}
                                                    <td><Button variant="primary"><i class="fa-solid fa-magnifying-glass"></i></Button></td>
                                                </tr>
                                            ))
                                        }




                                    </tbody>

                                </Table>
                            </div>
                        </div>


                    </div>
                </div>
            </div>
        </>
    )
}
